\frac{x}{2} + 1 & \text{if } x > 1။
\end{array}
\right.\]$f(x) = 0$ ဖြစ်သည့် $x$ ၏ တန်ဖိုးအားလုံး၏ ပေါင်းစုကို ရှာပါ။

