```python
class Solution:
    def excellentNumber(self, nums: List[int], k: int) -> bool:
        def check(num):
            count = 0
            for i in range(len(nums)):
                if nums[i] & num == num:
                    count += 1
            return count >= k
        if check(nums[0]):
            return True
        for i in range(1, len(nums)):
            if not check(nums[i]):
                continue
            for j in range(i+1, len(nums)):
                if not check(nums[j]):
                    continue
                num = nums[i]^nums[j]
                if check(num):
                    return True
        return False
```

